import React, { Component } from "react";
import Box from "../Box/Box";

import "./Grid.css";
class Grid extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div>
        <table id="grid">
          <tbody>
            <tr>
              <Box />
              <Box />
            </tr>
            <tr>
              <Box />
              <Box />
            </tr>
          </tbody>
        </table>
        <input type="button" onClick={this.func()} />
      </div>
    );
  }

  func() {
    var table = document.getElementById("grid");
    var row = table.insertRow(0);
    var cell1 = row.insertCell(0);
    var cell2 = row.insertCell(1);
    cell1.innerHTML = <Box />;
    cell2.innerHTML = <Box />;
  }

  PrintEle(ele) {
    console.log(ele);
  }
}

export default Grid;
